import React, {Component} from 'react';
import Navbar from 'react-bootstrap/Navbar';


class NavB extends Component{
    render(){
        return

            <Navbar sticky="top">
                <Navbar.Brand href="#home">OjO</Navbar.Brand>
            </Navbar>

    }
}
export default NavB;
